class Submission:
    def __init__(self, user_id, content):
        self.user_id = user_id
        self.content = content
        self.published = False
        self.validated = False
        self.issues = []

    def validate(self):
        if not self.content:
            self.issues.append("Submission content cannot be empty.")
        elif len(self.content) < 10:
            self.issues.append("Submission content must be at least 10 characters long.")
        else:
            self.validated = True

    def update_publish_status(self, status):
        if status and not self.published:
            self.published = True
        elif not status and self.published:
            self.published = False

class SubmissionManager:
    def __init__(self):
        self.submissions = []
        self.submission_ids = set()

    def upload_submission(self, user_id, content):
        if user_id in self.submission_ids:
            return "Submission already exists for this user."
        submission = Submission(user_id, content)
        self.submissions.append(submission)
        self.submission_ids.add(user_id)
        return submission

    def validate_submission(self, submission):
        submission.validate()
        return submission.issues

    def update_publish_status(self, submission, status):
        submission.update_publish_status(status)

    def list_current_submissions(self):
        return [(s.user_id, s.published, s.validated) for s in self.submissions]

class FABSNotifier:
    def __init__(self):
        self.subscribers = []

    def subscribe(self, user_id):
        if user_id not in self.subscribers:
            self.subscribers.append(user_id)

    def notify(self, message):
        for subscriber in self.subscribers:
            print(f"Notification to {subscriber}: {message}")

class UIManager:
    def __init__(self):
        self.user_testing_results = []

    def redesign_resources_page(self, design_feedback):
        print("Redesigning Resources page with feedback:", design_feedback)

    def report_user_testing_results(self, results):
        self.user_testing_results.append(results)
        print("User testing results reported:", results)

class IssueLogger:
    def __init__(self):
        self.issues = []

    def log_issue(self, submission, issue):
        self.issues.append({'submission': submission.content, 'issue': issue})

def prevent_double_publishing(submission):
    if submission.published:
        return "Submission already published."
    return "Submission can be published." 

# Sample usage
submission_manager = SubmissionManager()
notifier = FABSNotifier()
ui_manager = UIManager()
issue_logger = IssueLogger()

# User uploads a submission
submission = submission_manager.upload_submission("user123", "This is a valid submission.")
submission_manager.validate_submission(submission)

# Update publish status
submission_manager.update_publish_status(submission, True)

# List current submissions
print(submission_manager.list_current_submissions())

# Subscribe to FABS notifications
notifier.subscribe("user123")
notifier.notify("New FABS record available.")

# Log an issue with the submission
issue_logger.log_issue(submission, "Formatting issue detected.")

# Redesign resources page and report user testing results
ui_manager.redesign_resources_page("Make navigation more intuitive.")
ui_manager.report_user_testing_results("Users found navigation confusing.")
